<script lang="ts">
import Vue from "vue";
import { ZkEthereumNetworkName } from "@matterlabs/zksync-nuxt-core/types";

export default Vue.extend({
  name: "ProviderUtorg",
  computed: {
    network(): ZkEthereumNetworkName {
      return this.$store.getters["zk-provider/network"];
    },
    isSupported(): boolean {
      return this.network === "mainnet";
    },
  },
  methods: {
    proceed() {
      if (!this.isSupported) {
        this.$emit("providerError", `Provider Orbiter is not supported for the “${this.network}” network`);
        return;
      }
      this.$analytics.track("click_on_buy_with_orbiter");
      window.open(`https://www.orbiter.finance/?referer=zksync&dests=zksync&fixed=1`, "_blank");
    },
  },
});
</script>

